import React from 'react'
import AppLayout from '../components/AppLayout';
const profile = () => {
  const followingList = [
    {nickname:"제로초"},{nickname:"부기초"},{nickname:"거북초"}
  ]
  const followerList = [
    {nickname:"제로초"},{nickname:"부기초"},{nickname:"거북초"}
  ]
  return (
    <AppLayout>
      <NicknameEditForm />
      <FollowingList header="팔로잉 목록" />
      <FollowerList header="팔로워 목록" />
    </AppLayout>
  )
}

export default profile;
